  "translationLines": [
    {
      "lineNumber": 85141,
      "originalJapaneseLine": "「うあっ、ひっ、ああん！　や、やだ、ツンツンしないでー！」",
      "translatedEnglishLine": "\"Uah, hick, ahn! N-no, don't poke me!\""
    },
    {
      "lineNumber": 85142,
      "originalJapaneseLine": "「がははは、スポーツで汗を流すより、",
      "translatedEnglishLine": "\"Gahaha, rather than sweating it out in sports,"
    },
    {
      "lineNumber": 85143,
      "originalJapaneseLine": "　もーっと気持ち良くなれるものを教えてくれるわー！」",
      "translatedEnglishLine": "I'll teach you something that feels even better!\""
    },
    {
      "lineNumber": 85144,
      "originalJapaneseLine": "「最っっっ低！　けだものけだものけだものー！」",
      "translatedEnglishLine": "\"The absolute worst! Beast, beast, beast!\""
    },
    {
      "lineNumber": 85145,
      "originalJapaneseLine": "「おーーにぃーーーー――！」",
      "translatedEnglishLine": "\"Brotherrrrrr!\""
    },
    {
      "lineNumber": 85146,
      "originalJapaneseLine": "「ん？　なんだ？」",
      "translatedEnglishLine": "\"Hmm? What is it?\""
    },
    {
      "lineNumber": 85147,
      "originalJapaneseLine": "「ちゃーーーーーん！」",
      "translatedEnglishLine": "\"Chaaaaaan!\""
    },
    {
      "lineNumber": 85148,
      "originalJapaneseLine": "「どわぁぁぁーーーー！」",
      "translatedEnglishLine": "\"Dowaaaaa!\""
    },
    {
      "lineNumber": 85149,
      "originalJapaneseLine": "「きゃははは、お兄ちゃん、",
      "translatedEnglishLine": "\"Kyahahaha, big brother,"
    },
    {
      "lineNumber": 85150,
      "originalJapaneseLine": "　びっくりしてる、びっくりしてるー！」",
      "translatedEnglishLine": "You're surprised, you're surprised!\""
    },
    {
      "lineNumber": 85151,
      "originalJapaneseLine": "「当たり前だ、馬鹿者。",
      "translatedEnglishLine": "\"Of course, you idiot."
    },
    {
      "lineNumber": 85152,
      "originalJapaneseLine": "　誰かと思ったら手裏剣使いか……」",
      "translatedEnglishLine": "I wondered who it was, and it's a shuriken user...\""
    },
    {
      "lineNumber": 85153,
      "originalJapaneseLine": "「で、一人……もとい一匹で何やってたんだ？」",
      "translatedEnglishLine": "\"So, what were you doing alone... or rather, alone as one?\""
    },
    {
      "lineNumber": 85154,
      "originalJapaneseLine": "「手裏剣の修行だよ。",
      "translatedEnglishLine": "\"Training with shuriken."
    },
    {
      "lineNumber": 85155,
      "originalJapaneseLine": "　もーっと強くならないといけないんだから」",
      "translatedEnglishLine": "I have to get even stronger.\""
    },
    {
      "lineNumber": 85156,
      "originalJapaneseLine": "「そうなのか？」",
      "translatedEnglishLine": "\"Is that so?\""
    },
    {
      "lineNumber": 85157,
      "originalJapaneseLine": "「うん、手裏剣使いはマスターの命令が絶対！",
      "translatedEnglishLine": "\"Yeah, shuriken users absolutely follow the master's orders!"
    },
    {
      "lineNumber": 85158,
      "originalJapaneseLine": "　だから手裏剣ちゃんもお兄ちゃん達の",
      "translatedEnglishLine": "So, little Shuriken-chan will also do her best"
    },
    {
      "lineNumber": 85159,
      "originalJapaneseLine": "　お役に立てるように頑張るの！　えいえいっ！」",
      "translatedEnglishLine": "to be useful to you big brothers! Yay, yay!\""
    },
    {
      "lineNumber": 85160,
      "originalJapaneseLine": "「ほほーう、それは自分勝手な子が多い",
      "translatedEnglishLine": "\"Oh ho, that's a noble thought for monster girls who are often selfish."
    },
    {
      "lineNumber": 85161,
      "originalJapaneseLine": "　女の子モンスターにしては殊勝な考えだな」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 85162,
      "originalJapaneseLine": "「うん、手裏剣ちゃん、頑張るよー」",
      "translatedEnglishLine": "\"Yeah, Shuriken-chan will do her best!\""
    },
    {
      "lineNumber": 85163,
      "originalJapaneseLine": "「うーむ、なんか初っぱなから",
      "translatedEnglishLine": "\"Hmm, somehow from the very start"
    },
    {
      "lineNumber": 85164,
      "originalJapaneseLine": "　手裏剣使いは好感度が高いなぁ」",
      "translatedEnglishLine": "\"shuriken users have a high likability.\""
    },
    {
      "lineNumber": 85165,
      "originalJapaneseLine": "「うん、手裏剣ちゃんねー！",
      "translatedEnglishLine": "\"Yeah, Shuriken-chan!"
    },
    {
      "lineNumber": 85166,
      "originalJapaneseLine": "　お兄ちゃんも、オノハお姉ちゃんも大好きなの！",
      "translatedEnglishLine": "She loves big brother and Onoha big sister too!"
    },
    {
      "lineNumber": 85167,
      "originalJapaneseLine": "　だから頑張ってるの、とうとう！」",
      "translatedEnglishLine": "That's why she's trying her best, really!\""
    },
    {
      "lineNumber": 85168,
      "originalJapaneseLine": "「そかそか。",
      "translatedEnglishLine": "\"I see, I see."
    },
    {
      "lineNumber": 85169,
      "originalJapaneseLine": "　でも修行ばっかでは息が詰まるだろう」",
      "translatedEnglishLine": "But only training can get suffocating, right?\""
    },
    {
      "lineNumber": 85170,
      "originalJapaneseLine": "「俺とちょっと息抜きをしようではないか。",
      "translatedEnglishLine": "\"Why don't you take a little break with me?"
    },
    {
      "lineNumber": 85171,
      "originalJapaneseLine": "　それそれ、向こうの人影の少ない方へ……」",
      "translatedEnglishLine": "There, there, toward the side where there are fewer people...\""
    },
    {
      "lineNumber": 85172,
      "originalJapaneseLine": "「……ほえー？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 85173,
      "originalJapaneseLine": "「やっ、やあああああああん……",
      "translatedEnglishLine": "\"Y-yaaaan...\""
    },
    {
      "lineNumber": 85174,
      "originalJapaneseLine": "　お、お兄ちゃん、なにこれぇ……」",
      "translatedEnglishLine": "B-big brother, what is this...\""
    },
    {
      "lineNumber": 85175,
      "originalJapaneseLine": "「がははは、とーっても気持ちいい息抜きの方法だ。",
      "translatedEnglishLine": "\"Gahaha, this is a very pleasurable way to take a break."
    },
    {
      "lineNumber": 85176,
      "originalJapaneseLine": "　ほれほれ、そんな邪魔っけな手裏剣はポイしなさい」",
      "translatedEnglishLine": "Come on, throw away those pesky shuriken.\""
    },
    {
      "lineNumber": 85177,
      "originalJapaneseLine": "「あーん、手裏剣は手裏剣ちゃんの命なのにぃ〜……",
      "translatedEnglishLine": "\"Aahn, shuriken are Shuriken-chan's lifeline~..."
    },
    {
      "lineNumber": 85178,
      "originalJapaneseLine": "　あっ、ああっ、で、でも……どうでもいいのぉ……」",
      "translatedEnglishLine": "Ah, ah, bu-but... I don’t really care...\""
    },
    {
      "lineNumber": 85179,
      "originalJapaneseLine": "目尻をとろんとさせて、息の荒くなった手裏剣使いは、",
      "translatedEnglishLine": "With half-closed eyes and heavy breathing, the shuriken user"
    },
    {
      "lineNumber": 85180,
      "originalJapaneseLine": "腰をかすかに揺らしながら、ランスを潤んだ瞳で見上げる。",
      "translatedEnglishLine": "slightly swaying her hips, looks up at Lance with moist eyes."
    },
    {
      "lineNumber": 85181,
      "originalJapaneseLine": "「んー？　なにかね？",
      "translatedEnglishLine": "\"Hmm? What is it?"
    },
    {
      "lineNumber": 85182,
      "originalJapaneseLine": "　言いたいことがあるならハッキリ言っていいんだぞぉ」",
      "translatedEnglishLine": "If you have something to say, you can say it clearly.\""
    },
    {
      "lineNumber": 85183,
      "originalJapaneseLine": "「お、お兄ちゃん、あのね、あのね……",
      "translatedEnglishLine": "\"B-big brother, um, well, um..."
    },
    {
      "lineNumber": 85184,
      "originalJapaneseLine": "　お、お腹が熱くて、は、発情始まっちゃったみたいで、その……」",
      "translatedEnglishLine": "My stomach is hot, and it seems like... I've started to get in heat, so..."
    },
    {
      "lineNumber": 85185,
      "originalJapaneseLine": "「ああん……",
      "translatedEnglishLine": "\"Aahn..."
    },
    {
      "lineNumber": 85186,
      "originalJapaneseLine": "　もっと手裏剣ちゃんを……いけない子にしてぇ……」",
      "translatedEnglishLine": "Make little Shuriken-chan... into a naughty girl more...\""
    },
    {
      "lineNumber": 85187,
      "originalJapaneseLine": "「あ、お客様ですね。",
      "translatedEnglishLine": "\"Ah, a customer."
    },
    {
      "lineNumber": 85188,
      "originalJapaneseLine": "　いらっしゃいませ」",
      "translatedEnglishLine": "Welcome.\""
    },
    {
      "lineNumber": 85189,
      "originalJapaneseLine": "「アフターモードへようこそ。",
      "translatedEnglishLine": "\"Welcome to After Mode."
    },
    {
      "lineNumber": 85190,
      "originalJapaneseLine": "　アリスです」",
      "translatedEnglishLine": "I'm Alice.\""
    }
  ]
}

